import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Container } from "semantic-ui-react";

import "../css/Sidebar.css";

function App() {
  return (
    <Router>
      <Container>
        <div class="sidenav">
          <Link to="/">Home</Link>
          <Link to="/beneficiarios">Beneficiarios</Link>
          <Link to="/jornadas">Jornadas</Link>
          <Link to="/reportes">Reportes</Link>
          <Link to="/evaluaciones">Evaluaciones</Link>
          <Link to="/cuentas">Cuentas</Link>
        </div>
        <div class="main">
          <Route exact path="/">
            <Home />
          </Route>
          <Route path={beneficiarios}>
            <p>Beneficiarios</p>
          </Route>
          <Route path="/jornadas">
            <p>Jornadas</p>
          </Route>
          <Route path="/reportes">
            <p>Reportes</p>
          </Route>
          <Route path="/evaluaciones">
            <p>Evaluaciones</p>
          </Route>
          <Route path="/cuentas">
            <p>Cuentas</p>
          </Route>
        </div>
      </Container>
    </Router>
  );
}

function Home() {
  return (
    <div>
      <p>Home</p>
    </div>
  );
}

export default App;
